import { Link } from 'react-router-dom'

const Login = () => {
    return (
        <div className='loginMainDiv'>
            <form className='loginForm'>
            {['username', 'password'].map((item, index) => {
                if (index === 1 ) return <input type='password' name={item} placeholder={item} key={index} className='registerFormInput'></input>
                return <input type='text' name={item} placeholder={item} key={index} className='registerFormInput'></input>
            })}
            {/* <button className='submitButton' style={{width: 'auto'}}>Submit</button> */}
            </form>
        </div>
    )
}

export default Login
